import React from 'react';
import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <nav>
      <Link to="/">
        <button>
          Home
        </button>
      </Link>
      <a href="gallery">
        Blog
      </a>
      <Link to="/blog">
        <button>
          Blog
        </button>
      </Link>
    </nav>
  );
}
